# 超时了
class Solution:
    def lengthOfLongestSubstring(self, s: str) -> int:
        start = 0
        max_len = 0
        while start < len(s):
            tmp = self.subFuc(s[start:])
            if tmp > max_len:
                max_len = tmp
            start += 1
        return max_len

    def subFuc(self, s_1: str) -> int:
        max_len = 0
        for sl in range(1, len(s_1) + 1):
            if sl > max_len:
                if self.isInStr(s_1[:sl]):
                    if len(s_1[:sl]) > max_len:
                        max_len = len(s_1[:sl])
        return max_len

    def isInStr(self, t_s: str):
        for j in range(0, len(t_s)):
            if t_s[j] in (t_s[:j] + t_s[j + 1:]):
                return False
        return True


